function updateSets(newSets) {
	for (var pokemon in newSets) {
		for (var moveset in newSets[pokemon]) {
			if (!SETDEX_SS[pokemon]) SETDEX_SS[pokemon] = {};
			SETDEX_SS[pokemon][moveset] = newSets[pokemon][moveset];
		}
	}
}

